INSERT INTO `v1_4b3ee6df46443df31f545e871d056256a02d93e57a36db2d3d654f90560601df` VALUES (0.0, 129901, "訓練成功、おめでとうございます\n褒めるべき時にはしっかり褒めるのも\n教官の務めですものね。それとも、\n罵られる方が好みですか？　クスクス", 10142, 0.0, "2030/12/17 14:59:59", 10.85, "エリコ", 100, 1, 7, 24, 100, "2024/03/31 12:00:00");
INSERT INTO `v1_4b3ee6df46443df31f545e871d056256a02d93e57a36db2d3d654f90560601df` VALUES (0.0, 129901, "厳しい訓練も、終わってみれば\n短く感じるものですわね。\n正直、私は暴れ足りないくらい…\nいえ、何でもありませんわ。クスクス", 10142, 0.0, "2030/12/17 14:59:59", 11.15, "エリコ", 101, 1, 2, 24, 101, "2024/03/31 12:00:00");
INSERT INTO `v1_4b3ee6df46443df31f545e871d056256a02d93e57a36db2d3d654f90560601df` VALUES (0.0, 129901, "行く手を阻む忌々しい邪魔者を\n蹴散らして、見事ゴールイン…！\nまるで私とあのおかたの人生を\n象徴するような道のりでした…", 10142, 0.0, "2030/12/17 14:59:59", 6.4, "エリコ", 102, 7, 5, 24, 102, "2024/03/31 12:00:00");
INSERT INTO `v1_4b3ee6df46443df31f545e871d056256a02d93e57a36db2d3d654f90560601df` VALUES (0.0, 129901, "まったくもって不甲斐ない結果です\nしかし、挽回の機会はまだありますわ\n次はゴミ虫の地位から脱却できるよう\n死力を尽くしなさい。いいですね？", 10142, 0.0, "2030/12/17 14:59:59", 0.0, "エリコ", 103, 3, 3, 24, 103, "2024/03/31 12:00:00");
INSERT INTO `v1_4b3ee6df46443df31f545e871d056256a02d93e57a36db2d3d654f90560601df` VALUES (0.0, 129901, "クスクス…ああご心配なさらず\nなんとも情けない成績を残す輩には\nどんな罰が相応しいか、考えている\nだけですので…クスクスクス", 10142, 0.0, "2030/12/17 14:59:59", 2.43, "エリコ", 104, 2, 8, 24, 104, "2024/03/31 12:00:00");
INSERT INTO `v1_4b3ee6df46443df31f545e871d056256a02d93e57a36db2d3d654f90560601df` VALUES (0.0, 129901, "私が教官として認められなければ、\nあのおかたを失望させてしまう…\nそれだけはあってはなりません\nあなた方も、わかっていますわね？", 10142, 0.0, "2030/12/17 14:59:59", 9.08, "エリコ", 105, 4, 3, 24, 105, "2024/03/31 12:00:00");
INSERT INTO `v1_4b3ee6df46443df31f545e871d056256a02d93e57a36db2d3d654f90560601df` VALUES (0.0, 129901, "まずまずの結果ではありますが、\nこの程度で満足してもらっては\n困りますわ。エリコ班の一員として、\nより高みを目指していただきますので", 10142, 0.0, "2030/12/17 14:59:59", 0.0, "エリコ", 106, 6, 6, 24, 106, "2024/03/31 12:00:00");
INSERT INTO `v1_4b3ee6df46443df31f545e871d056256a02d93e57a36db2d3d654f90560601df` VALUES (0.0, 129901, "私の指導を受けながら、この結果は…\nもっと真剣に考えねばなりませんね\nあなた方が怠けずにいるには、\nどんなしつけが必要かを…クスクス", 10142, 0.0, "2030/12/17 14:59:59", 10.6, "エリコ", 107, 3, 8, 24, 107, "2024/03/31 12:00:00");
INSERT INTO `v1_4b3ee6df46443df31f545e871d056256a02d93e57a36db2d3d654f90560601df` VALUES (0.0, 129901, "ひとまず訓練をこなしたご褒美か、\n実力を出しきれたとは言えない罰か…\nみなさんにどちらを与えるべきか\n少し悩む結果ですわね", 10142, 0.0, "2030/12/17 14:59:59", 7.54, "エリコ", 108, 6, 4, 24, 108, "2024/03/31 12:00:00");
INSERT INTO `v1_4b3ee6df46443df31f545e871d056256a02d93e57a36db2d3d654f90560601df` VALUES (0.0, 129901, "なかなかいい戦いぶりでしたわ\nこれもあなた方の頑張りと、何より\n優秀な教官である私の教育の賜物\nそうですわね？　クスクスクス…", 10142, 0.0, "2030/12/17 14:59:59", 11.5, "エリコ", 109, 2, 7, 24, 109, "2024/03/31 12:00:00");
INSERT INTO `v1_4b3ee6df46443df31f545e871d056256a02d93e57a36db2d3d654f90560601df` VALUES (0.0, 129901, "これだけ進めたのならば合格点ですわ\nでも、もっと高みを目指したいと\n思っているのなら…さらなる訓練にも\n付き合って差し上げましょう", 10142, 0.0, "2030/12/17 14:59:59", 8.83, "エリコ", 110, 2, 1, 24, 110, "2024/03/31 12:00:00");
INSERT INTO `v1_4b3ee6df46443df31f545e871d056256a02d93e57a36db2d3d654f90560601df` VALUES (0.0, 129901, "未熟で頼りなかったあなた方が、\n見違えるように成長しました\nなるほど…これこそが、教官冥利に\n尽きるという気持ちなのですね", 10142, 0.0, "2030/12/17 14:59:59", 6.68, "エリコ", 111, 1, 2, 24, 111, "2024/03/31 12:00:00");
INSERT INTO `v1_4b3ee6df46443df31f545e871d056256a02d93e57a36db2d3d654f90560601df` VALUES (0.0, 129901, "まさかあなた方が、私の予想すら\n超える力を発揮するとは…驚きました\nもはやゴミ虫などではありません\n一人前の騎士として胸を張りなさい", 10142, 0.0, "2030/12/17 14:59:59", 8.8, "エリコ", 112, 6, 2, 24, 112, "2024/03/31 12:00:00");
INSERT INTO `v1_4b3ee6df46443df31f545e871d056256a02d93e57a36db2d3d654f90560601df` VALUES (0.0, 129901, "クスクス、見事な働きです\nみなさんならできると信じていました\n他でもない私の指導を受けた、\nエリコ班の優秀な新兵なのですから", 10142, 0.0, "2030/12/17 14:59:59", 8.9, "エリコ", 113, 2, 1, 24, 113, "2024/03/31 12:00:00");
INSERT INTO `v1_4b3ee6df46443df31f545e871d056256a02d93e57a36db2d3d654f90560601df` VALUES (0.0, 129901, "なんてすばらしい成績…！\n今日という日は『あのおかたを想い\nエリコが限界を超えた記念日』として\n歴史に刻まれることでしょう…！", 10142, 0.0, "2030/12/17 14:59:59", 3.7, "エリコ", 114, 2, 5, 24, 114, "2024/03/31 12:00:00");
INSERT INTO `v1_4b3ee6df46443df31f545e871d056256a02d93e57a36db2d3d654f90560601df` VALUES (0.0, 129801, "よし、いい訓練になったな\nおまえたちもよく動けてたし、\nちゃんと成長できてると思うぜ\nその調子で頑張れよっ", 10142, 0.0, "2030/12/17 14:59:59", 7.6, "マコト", 200, 1, 2, 24, 200, "2024/03/31 12:00:00");
INSERT INTO `v1_4b3ee6df46443df31f545e871d056256a02d93e57a36db2d3d654f90560601df` VALUES (0.0, 129801, "ひとまずゴールおめでとう！\nでも、努力は継続してこそだからな\nおまえたちにやる気があるなら、\n何度だって付き合ってやるよ", 10142, 0.0, "2030/12/17 14:59:59", 2.25, "マコト", 201, 2, 1, 24, 201, "2024/03/31 12:00:00");
INSERT INTO `v1_4b3ee6df46443df31f545e871d056256a02d93e57a36db2d3d654f90560601df` VALUES (0.0, 129801, "行軍訓練はこれにて完了！\n…なーんて思ってないよな？\n学んだことが体に染みつくまで\n地道に繰り返すのが練習ってもんさ", 10142, 0.0, "2030/12/17 14:59:59", 3.28, "マコト", 202, 2, 1, 24, 202, "2024/03/31 12:00:00");
INSERT INTO `v1_4b3ee6df46443df31f545e871d056256a02d93e57a36db2d3d654f90560601df` VALUES (0.0, 129801, "みんなに無理をさせちまったか…\nでもこれで諦めることはないぜ\n次はきっとうまくいく。そう信じて\n鍛え続ければ、道は開けるはずだ！", 10142, 0.0, "2030/12/17 14:59:59", 2.98, "マコト", 203, 4, 1, 24, 203, "2024/03/31 12:00:00");
INSERT INTO `v1_4b3ee6df46443df31f545e871d056256a02d93e57a36db2d3d654f90560601df` VALUES (0.0, 129801, "こいつは悔しい結果だな…\nま、反省点はいろいろあったし\nひとつずつ乗り越えていこう\nあたしたちで力を合わせて、なっ！", 10142, 0.0, "2030/12/17 14:59:59", 3.0, "マコト", 204, 4, 1, 24, 204, "2024/03/31 12:00:00");
INSERT INTO `v1_4b3ee6df46443df31f545e871d056256a02d93e57a36db2d3d654f90560601df` VALUES (0.0, 129801, "おまえたちはまだ未熟な訓練兵、\n失敗を必要以上に悔やむことはねえよ\nでも実戦じゃこうはいかないからな\n次は気合を入れ直していけよっ！", 10142, 0.0, "2030/12/17 14:59:59", 10.3, "マコト", 205, 1, 2, 24, 205, "2024/03/31 12:00:00");
INSERT INTO `v1_4b3ee6df46443df31f545e871d056256a02d93e57a36db2d3d654f90560601df` VALUES (0.0, 129801, "これがおまえたちの全力？\nいやいや、そんなはずはないよなっ\nおまえらならもっと強くなれる！\nあたしが言うんだ、間違いないぜ！", 10142, 0.0, "2030/12/17 14:59:59", 2.93, "マコト", 206, 6, 1, 24, 206, "2024/03/31 12:00:00");
INSERT INTO `v1_4b3ee6df46443df31f545e871d056256a02d93e57a36db2d3d654f90560601df` VALUES (0.0, 129801, "おまえたちの実力を考えりゃ、\nベストを尽くせたとは言えない成績だ\nなら、次やるべきことも決まってる\n気持ちを切り替えて、鍛え直すんだ！", 10142, 0.0, "2030/12/17 14:59:59", 9.3, "マコト", 207, 3, 1, 24, 207, "2024/03/31 12:00:00");
INSERT INTO `v1_4b3ee6df46443df31f545e871d056256a02d93e57a36db2d3d654f90560601df` VALUES (0.0, 129801, "まだまだ課題がある内容だったな～\n無駄な動き、判断の遅れ…\nそういうのをしっかり直していけば、\n記録ももっと伸びるはずだっ", 10142, 0.0, "2030/12/17 14:59:59", 6.9, "マコト", 208, 4, 1, 24, 208, "2024/03/31 12:00:00");
INSERT INTO `v1_4b3ee6df46443df31f545e871d056256a02d93e57a36db2d3d654f90560601df` VALUES (0.0, 129801, "ここまでいけりゃ、合格点！\nむしろ、最初の頼りなさを思えば\nすげえ成長してるんじゃねえか？\n胸を張れる結果だと思うぜっ！", 10142, 0.0, "2030/12/17 14:59:59", 0.0, "マコト", 209, 2, 2, 24, 209, "2024/03/31 12:00:00");
INSERT INTO `v1_4b3ee6df46443df31f545e871d056256a02d93e57a36db2d3d654f90560601df` VALUES (0.0, 129801, "なかなかハードな訓練だったけど、\nみんなしっかりついてこられたな\n地道に続けた基礎トレの成果が\n形になってる、その証だぜっ", 10142, 0.0, "2030/12/17 14:59:59", 5.95, "マコト", 210, 1, 2, 24, 210, "2024/03/31 12:00:00");
INSERT INTO `v1_4b3ee6df46443df31f545e871d056256a02d93e57a36db2d3d654f90560601df` VALUES (0.0, 129801, "今回の訓練もよく頑張ったな！\nしっかり休んで次に備えろよ！\nなんつーか、教え子が成長してくのを\n見るのは楽しいもんだな…", 10142, 0.0, "2030/12/17 14:59:59", 6.73, "マコト", 211, 2, 1, 24, 211, "2024/03/31 12:00:00");
INSERT INTO `v1_4b3ee6df46443df31f545e871d056256a02d93e57a36db2d3d654f90560601df` VALUES (0.0, 129801, "おまえら、すげえじゃねえか！\nこれならもう、ひよっこ新兵なんて\n言えねえな。きっと騎士団でも\n大活躍間違いなしだぜ！", 10142, 0.0, "2030/12/17 14:59:59", 0.0, "マコト", 212, 2, 2, 24, 212, "2024/03/31 12:00:00");
INSERT INTO `v1_4b3ee6df46443df31f545e871d056256a02d93e57a36db2d3d654f90560601df` VALUES (0.0, 129801, "敵との戦い方、状況判断の正確さ\n何より根性…どれも最高だったぞ！\nうかうかしてたら、教官のあたしまで\n追い抜かれちまうかもな…へへっ", 10142, 0.0, "2030/12/17 14:59:59", 6.65, "マコト", 213, 1, 2, 24, 213, "2024/03/31 12:00:00");
INSERT INTO `v1_4b3ee6df46443df31f545e871d056256a02d93e57a36db2d3d654f90560601df` VALUES (0.0, 129801, "あたしの指導が良かった？\nいやいや、ここまで強くなれたのは、\n他でもないおまえたち自身が努力した\nおかげだよ。改めて…おめでとうっ！", 10142, 0.0, "2030/12/17 14:59:59", 3.05, "マコト", 214, 6, 1, 24, 214, "2024/03/31 12:00:00");
